import React from "react";
import Navbar from "../Components/Navbar";

export default function ResumePage() {
  return (
    <>
      <div className="bg-black fixed  block h-36 w-full md:h-20">
        <Navbar />
      </div>
      <section className="flex pt-32">
        <div className="m-auto ">
            <div className="flex">
                <h1>Mohit Sharma</h1>

            </div>


        </div>
      </section>



    </>
  );
}
